import React from "react";
import Navbar from "./component/navbar";
import Login from "./component/login";
import Introtext from "./component/introtext";

const Home = () => {
  return (
    <div>
      <Navbar />
      <Introtext />
      <Login />
    </div>
  );
};

export default Home;
